import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import './css/login.css'

function TabPanel(props) {
    const { children, value, index, ...other } = props;
  
    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
}

const handleChange = (event, newValue) => {
    setValue(newValue);
};

function Login(props) {
    return(
        <div className='login-page'>
            <div className='login-form'>
                <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
                    <Tab label="Item One" {...a11yProps(0)} />
                    <Tab label="Item Two" {...a11yProps(1)} />
                    <Tab label="Item Three" {...a11yProps(2)} />
                </Tabs>
                <TabPanel value={value} index={0}>
                    Item One
                </TabPanel>
                <TabPanel value={value} index={1}>
                    Item Two
                </TabPanel>
                <div className='login-form__header'>
                    <h1>DoS</h1>
                    <h1>Đăng nhập</h1>
                    <h4>Tiếp tục với tài khoản DocShare</h4>
                </div>
                <div className='login-form__body'>
                    <TextField id="outlined-basic" label="Tên đăng nhập" variant="outlined" className='lgf_b-textField' margin="normal"/>
                    <TextField id="outlined-basic" label="Mật khẩu" variant="outlined" className='lgf_b-textField'margin="normal"/>
                </div>
                <div className='login-form__bottom'>
                    <Button variant="text" size="small" className='btn-registration'>Tạo tài khoản</Button>
                    <Button variant="contained" size="medium" className='btn-login'>Đăng nhập</Button>
                </div>
            </div>
        </div>
    )
}

export default Login;
